import React, { useEffect, useState } from 'react';
import { Tabs } from 'antd';
import axios from 'axios';

const { TabPane } = Tabs;

function AdminScreen() {
  return (
    <div className="mt-3 m-3 boxshadow">
      <h1 className="text-center" style={{ fontSize: '30px' }}>
        <b>Admin panel</b>
      </h1>
      <Tabs defaultActiveKey="1">
        <TabPane tab="Bookings" key="1">
          <Bookings />
        </TabPane>
        <TabPane tab="Rooms" key="2">
          <h1>Rooms</h1>
        </TabPane>
        <TabPane tab="Add Room" key="3">
          <h1>Add Room</h1>
        </TabPane>
        <TabPane tab="Bathrooms" key="4">
          <h1>Bathrooms</h1>
        </TabPane>
        <TabPane tab="Add Bathroom" key="5">
          <h1>Add Bathroom</h1>
        </TabPane>
        <TabPane tab="Clients" key="6">
          <h1>Clients</h1>
        </TabPane>
      </Tabs>
    </div>
  );
}

export default AdminScreen;

export function Bookings() {
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(false);
  const [clientInfo, setClientInfo] = useState([]);

  useEffect(() => {
    const fetchBookings = async () => {
      try {
        setLoading(true);
        const response = await axios.get('/api/v1/reservations');
        setBookings(response.data);
        setLoading(false);
      } catch (error) {
        setError(true);
        setLoading(false);
        console.log('Error fetching bookings:', error);
      }
    };

    fetchBookings();
  }, []);

  useEffect(() => {
    const fetchClientInfo = async () => {
      try {
        const clientIds = bookings.map(booking => booking.idClient);
        const requests = clientIds.map(clientId => axios.get(`/api/v1/clients/${clientId}`));
        const responses = await Promise.all(requests);
        const clientData = responses.map(response => response.data);
        setClientInfo(clientData);
      } catch (error) {
        console.log('Error fetching client information:', error);
      }
    };

    if (bookings.length > 0) {
      fetchClientInfo();
    }
  }, [bookings]);

  return (
    <div className="row">
      <div className="col-md-10">
        <table className="table table-border table-dark">
          <thead className="boxshadow">
            <tr>
              <th>Booking Id</th>
              <th>House Id</th>
              <th>Start date</th>
              <th>End date</th>
              <th>Client name</th>
              <th>Client email</th>
              <th>Client phone-number</th>
              <th>Client address</th>
            </tr>
          </thead>
          <tbody>
            {loading ? (
              <tr>
                <td>Loading...</td>
              </tr>
            ) : error ? (
              <tr>
                <td>Error</td>
              </tr>
            ) : (
              bookings.map(booking => {
                const info = clientInfo.find(client => client.id === booking.idClient);
                return (
                  <tr key={booking.id}>
                    <td>{booking.id}</td>
                    <td>{booking.idHouse}</td>
                    <td>{booking.startDate}</td>
                    <td>{booking.endDate}</td>
                    <td>{info?.name}</td>
                    <td>{info?.email}</td>
                    <td>{info?.phoneNumber}</td>
                    <td>{info?.address}</td>
                  </tr>
                );
              })
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}
